 "class": "HTMLText",
 "paddingLeft": 10,
 "paddingTop": 10,
 "height": "37%",
 "paddingBottom": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">The OKUMA MC-60-VAE vertical CNC machining center is a prime product manufactured by OKUMA Cooperation, a top-tier machine tool builder based in Japan. This 4-axis CNC machine consists of three linear axes, namely X, Y, Z, and a rotary axis \u2018A\u2019.</SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">These X, Y, and Z linear axes can travel a maximum distance of 1500mm, 600mm, and 600mm respectively. This machining center consists of a spindle with a maximum speed of 5000RPM, a tool magazine that holds up to 20 tools, an Okuma controller, a 1500mm x 635mm machine bed, and a coolant system. Various types of processes such as milling, drilling, tapping, boring, and engraving can be performed using this vertical CNC machine. Moreover, these type of machining centers are used for industries that require high precision such as aerospace, automobile, mold manufacturing, and machinery manufacturing industries.</SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
