 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">UNICH LKJ1390 is a laser cutting machine, mainly used for engraving, and cutting non-metallic materials such as acrylic, glass, rubber, and leather. </SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">For Further reading: <SPAN STYLE=\"color:#f3a22e;\"><A HREF=\"https://www.youtube.com/watch?v=iM4uIQJRkb4\" TARGET=\"_blank\" STYLE=\"text-decoration:none; color:inherit;\"><U>https://www.youtube.com/watch?v=iM4uIQJRkb4</U></A></SPAN></SPAN></DIV></div>",
