 "class": "HTMLText",
 "paddingLeft": 10,
 "paddingTop": 10,
 "height": "36%",
 "paddingBottom": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">The BOY 50 T2 injection molding machine is manufactured by Dr. BOY, an injection molding machine builder based in Germany. This machine has been engineered to process thermoplastic materials and has a clamping force of 518kN. The mold opening stroke is approximately 300mm x 280mm x 350mm (h x v x l) and has a hopper capacity of 58 Liters. The screws with diameters of 28mm, 32mm, 38mm, and 42 mm which have injection rates of 58.22, 76.91, 108.17, and 129.26 g/s respectively, can be used in this machine. The injection molding machine is mainly used for mass production of products which takes a large part in plastic processing.</SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">For further reading: <SPAN STYLE=\"color:#f3a22e;\"><A HREF=\"https://www.youtube.com/watch?v=ndky3V9KHGQ\" TARGET=\"_blank\" STYLE=\"text-decoration:none; color:inherit;\"><U>https://www.youtube.com/watch?v=ndky3V9KHGQ</U></A></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
