 "paddingBottom": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">The OKUMA CNC Turning center (Model: LB300 OSP U100L) is a prime product manufactured by the OKUMA Cooperation, which is a top-tier machine tool builder based in Japan. This CNC turning center is a 3-axis machine, which operates in X and Z linear axes and in a rotary axis. The length, width, and height of the machine are 137\u201d, 80\u201d, and 69\u201d while the machining length consists of 519.94mm respectively. Furthermore, the spindle can be operated at a maximum rate of 4500 RPM and has a maximum power of 22.4kW. The machine comprises a 254mm chuck and could hold a bar with a maximum diameter(radius) of 73.66mm. </SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">CNC turning center is used to perform a wide range of operations such as turning, facing, grooving, parting, threading and boring. This is mainly used for large-batch manufacturing of products to maintain exact dimensions among all products and to increase the production capacity. </SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
