 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Ultimaker 2 Extended + printer is a Fused Deposition Modeling (FDM) machine where the printer works with extruding thermoplastic filaments, such as Acrylonitrile Butadiene Styrene (ABS), Polylactic Acid (PLA), rubber (TPU), nylon, through a heated nozzle, melting the material and applying the plastic layer by layer to a build platform. Each layer is laid down one at a time until the part is complete.</SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">For further reading: <SPAN STYLE=\"color:#f3a22e;\"><A HREF=\"https://www.youtube.com/watch?v=xnajNeNlTsE\" TARGET=\"_blank\" STYLE=\"text-decoration:none; color:inherit;\"><U>https://www.youtube.com/watch?v=xnajNeNlTsE</U></A></SPAN></SPAN></DIV></div>",
