 "paddingRight": 10,
 "minWidth": 0,
 "backgroundOpacity": 0,
 "width": "100%",
 "shadow": false,
 "class": "HTMLText",
 "paddingLeft": 10,
 "paddingTop": 10,
 "height": "39%",
 "paddingBottom": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Series 1 3D printer is a Fused Deposition Modeling (FDM) machine where the printer works with extruding thermoplastic filaments, such as Acrylonitrile Butadiene Styrene (ABS), Polylactic Acid (PLA), through a heated nozzle, melting the material and applying the plastic layer by layer to a build platform. Each layer is laid down one at a time until the part is complete.</SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">This printer features an aluminum and acrylic body, a glass build surface with one cubic foot of build volume, and a precision laser cut CNC folded metal chassis. This machine has easy bed-leveling and a revolutionary interface for network 3D printing. The printer supports Wi-Fi connectivity, a heated glass bed, and an extruder with multi-material support.</SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">Series 1 3D printer can record and monitor the progress of the print. It can review and share for troubleshooting support. The heated build platform can reach up to a maximum of 120\u00b0C making it ready to produce parts in under 4 minutes. </SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
