 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">XFAB is a 3D printer manufactured by an Italian company called DWS Systems. The XFAB machine uses photopolymerization 3D printing technology that relies on photosensitive liquid, also known as photopolymer, contained in a vat or tank that is selectively cured by a heat source. </SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\">For more reading: <SPAN STYLE=\"color:#f3a22e;\"><A HREF=\"https://www.youtube.com/watch?v=YPLLE4zFtas\" TARGET=\"_blank\" STYLE=\"text-decoration:none; color:inherit;\"><U>https://www.youtube.com/watch?v=YPLLE4zFtas</U></A></SPAN></SPAN></DIV></div>",
