 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;\">Professor R. J. K. S. K. Ranatunga; a student from Ibbagamuwa Central College, entered the Faculty of Engineering as an undergraduate in the year 1964. After graduation in 1967, he joined the Department of Mechanical Engineering as an assistant lecturer. In 1970, he left to the University of Birmingham, UK, for his PhD. In 1974 Prof. Ranatunga returned from the UK and joined the Department of Production Engineering as a lecturer.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:15px;\">For further reading: </SPAN><SPAN STYLE=\"color:#f3a22e;\"><A HREF=\"https://mie.pdn.ac.lk/apsrmf-overview.html\" TARGET=\"_blank\" STYLE=\"text-decoration:none; color:inherit;\"><SPAN STYLE=\"font-size:15px;\"><U>https://mie.pdn.ac.lk/apsrmf-overview.html</U></SPAN></A></SPAN></SPAN></DIV></div>",
